      if(desc.includes(converted[y].toLocaleLowerCase())) { // if animal is found
        errors("AI: Sentiment analysis in progress..") // Checks if text is positive, neutral or negative
        sentiment_analysis(desc, good, bad)
        break;
      }
      else {
        errors("AI: I don't know such an animal, pls change your description.")
      }
    }*/
}

function Image() {
    const [desc, setDesc] = useState("");
    const [good, setGood] = useState("");
    const [bad, setBad] = useState("");
    const [errorMessage, setErrorMessage] = useState(null);
  
    useEffect(() => {
      /* Assign update to outside variable */
      errors = setErrorMessage
  
      /* Unassign when component unmounts */
      return () => errors = null
    })

    // Reading animal.json
    const getData=()=>{
      fetch('animals.json'
      ,{
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
      }
      )
        .then(function(response){
          console.log(response)
          return response.json();
        })
        .then(function(myJson) {
          console.log(myJson);
        });
    }
    useEffect(()=>{
      /* Assign update to outside variable */
      animals = getData

      /* Unassign when component unmounts */
      return () => animals = null
    },[])

    const handleSubmit = (event) => {
      event.preventDefault();
      
      setErrorMessage("AI: Checking description for 'animals'..")
      animalVocab(desc.toLocaleLowerCase(), good.toLocaleLowerCase(), bad.toLocaleLowerCase());

      // Send 3 requests to DALL-E mini with descriptions
      // Save images in redux for future usage
      }
    return (
        <div>
            <h1>Image Generation</h1>
            <form onSubmit={handleSubmit}>
            <label>Description:
                <input 
                type="text" 
                value={desc}
                onChange={(e) => setDesc(e.target.value)}
                />
            </label>
            <label>Write adjectives to describe 'good' state of NFT:
                <input 
                type="text" 
                value={good}
                onChange={(e) => setGood(e.target.value)}
                />
            </label>
            <label>Write adjectives to describe 'bad' state of NFT:
                <input 
                type="text" 
                value={bad}
                onChange={(e) => setBad(e.target.value)}
                />
            </label>
            <input type="submit" />
            </form>
            <h3>{errorMessage}</h3>
        </div>
    );
}

export default Image;
